import axios from 'axios';
export const uploadResume = (formData) => axios.post('http://localhost:5000/api/candidates', formData);
export const addExperience = (id, exp) => axios.post(`http://localhost:5000/api/candidates/${id}/experience`, exp);
export const matchJobs = (id) => axios.get(`http://localhost:5000/api/candidates/${id}/match`);
export const getJobs = () => axios.get('http://localhost:5000/api/jobs');
export const createJob = (job) => axios.post('http://localhost:5000/api/jobs', job);
export const updateJob = (id, reqs) => axios.put(`http://localhost:5000/api/jobs/${id}`, reqs);
